import React from "react";
import '../css/section4.css'
import teacher from '../images/teacher.png';
class Section4 extends React.Component{
    render(){
        return(
            <section className="Section4">
                <h1 className="Section4-h1">Наши преподаватели</h1>
                <p className="Section4-text">Мы проводим строгий отбор на роль преподавателя и приглашаем на работу только лучших специалистов</p>

                <div className="Section4-block">
                    <img src={teacher} className=" "/ >
                </div>
            </section>
        )
    }
}
export default Section4;
